import {useInView} from "react-intersection-observer";
import { InView } from "framer-motion";
export default function page2(){
    inView("li", ({ target }) => {
        animate(target, { opacity: 1 })
      })
    return(
        <div>
            <section className="div1"> </section>
            <section className="div2"> </section>
        </div>
    )
        
    
}
